        var i = 1
        while (i <= n) {
            if (i * (i + 1) / 2 > n) {
                return i - 1
            }
            i++
        }
        return n
    }

    fun binarySearch(n: Int): Int {
        var lo = 0
        var hi = n
        while (lo < hi) {
            val mid = lo + (hi - lo) / 2
            if (mid * (mid + 1) / 2 > n) {
                hi = mid
            } else {
                lo = mid + 1
            }
        }
        return lo - 1
    }
}

class Solution {
    fun uniquePathsWithObstacles(obstacleGrid: Array<IntArray>): Int {
        val m = obstacleGrid.size
        val n = obstacleGrid[0].size
        val dp = Array(m) { IntArray(n) }
        for (i in 0 until m) {
            for (j in 0 until n) {
                if (obstacleGrid[i][j] == 1) {
                    dp[i][j] = 0
                } else if (i == 0 && j == 0) {
                    dp[i][j] = 1
                } else if (i == 0) {
                    dp[i][j] = dp[i][j - 1]
                } else if (j == 0) {
                    dp[i][j] = dp[i - 1][j]
                } else {
                    dp[i][j] = dp[i - 1][j] + dp[i][j - 1]
                }
            }
        }
        return dp[m - 1][n - 1]
    }
}

