fun maxSumAfterPartitioning(arr: IntArray, k: Int): Int {
    val n = arr.size
    val dp = IntArray(n)
    for (i in 0 until n) {
        var max = arr[i]
        for (j in i until minOf(i + k, n)) {
            max = maxOf(max, arr[j])
            dp[j] = maxOf(dp[j], dp[i] + max * (j - i + 1))
        }
    }
