fun threeSumClosest(nums: IntArray, target: Int): Int {
    nums.sort()
    var closest = Int.MAX_VALUE
    for (i in 0 until nums.size - 2) {
        var j = i + 1
        var k = nums.size - 1
        while (j < k) {
            val sum = nums[i] + nums[j] + nums[k]
            if (sum == target) {
                return target
            }
            if (sum < target) {
                if (target - sum < closest) {
                    closest = target - sum
                }
                j++
            } else {
                if (sum - target < closest) {
                    closest = sum - target
                }
                k--
            }
        }
    }
    return closest
}

