class WeightedQuickUnionWithPathCompressionUF(private val N: Int) {
    private val id: IntArray = IntArray(N) { it }
    private val sz: IntArray = IntArray(N) { 1 }

    fun union(p: Int, q: Int) {
        val pRoot = find(p)
        val qRoot = find(q)
        if (pRoot == qRoot) return
        if (sz[pRoot] < sz[qRoot]) {
            id[pRoot] = qRoot
            sz[qRoot] += sz[pRoot]
        } else {
            id[qRoot] = pRoot
            sz[pRoot] += sz[qRoot]
        }
    }

    fun find(p: Int): Int {
        var p = p
        while (p != id[p]) {
            p = id[p]
        }
        return p
    }
